description:
Punk Provision - Moscow crossover group. 
Happy birthday group will be the first concert - on 16th February 2008 opening for the group Purgen. 
Since the end of 2008go, the group begins to play in the style of crossover.
And not forcing themselves into specific style frames, these guys are in reasonable proportions mix different permutations of punk and metal.

